import ExpenseItem from "./components/ExpenseItem";
function Expense(usingpops){

    return(
        <div>
      <ExpenseItem title={usingpops.expense[0].title} amount={usingpops.expense[0].amount} date = {usingpops.expense[0].date} />
      <ExpenseItem title={usingpops.expense[1].title} amount={usingpops.expense[1].amount} date = {usingpops.expense[1].date} />
      <ExpenseItem title={usingpops.expense[2].title} amount={usingpops.expense[2].amount} date = {usingpops.expense[2].date} />
      <ExpenseItem title={usingpops.expense[3].title} amount={usingpops.expense[3].amount} date = {usingpops.expense[3].date} />
      </div>

    )
}
export default Expense;
